import React from "react";
import "./AppLogo.css";

const AppLogo = function (props) {
    function handleLink(event) {
        event.preventDefault();
    }
    return (
        <div>
            <a href="/" onClick={e => handleLink(e) }>EXAM SHOP</a>
        </div>
    );
}

export default AppLogo;
